import loginPage from '../page-objects/auth.page.js'
import naviSec from '../page-objects/nav.section.js'

describe('automation practice page access', () => {
    xit('should have the right title', () => {
        browser.url('http://automationpractice.com/index.php');
        const title = browser.getTitle();
        expect(title).toEqual('My Store');
    })
    xit('authentication behavior of existing user', () => {
        browser.url('');
        //browser.saveScreenshot(`./screenshots/${test.description}.png`); //para guardar una screenshot si llegase a fallar el test
        naviSec.login();
        loginPage.username.setValue('adelquis.trinidad@endava.com');
        loginPage.password.setValue('abc123');
        loginPage.submit();
        const title = browser.getTitle();
        expect(title).toEqual('My account - My Store');
    })
    xit('authentication behavior of unexisting user', () => {
        browser.url('');
        naviSec.login();
        loginPage.username.setValue('usuario.inexistente@endava.com');
        loginPage.password.setValue('abc123');
        loginPage.submit();
        const alert = $('.alert-danger li').getText();
        expect(alert).toEqual('Authentication failed.');
    })
    xit('authentication - verify email address field required', () => {
        browser.url('');
        naviSec.login();
        loginPage.username.setValue('');
        loginPage.password.setValue('');
        loginPage.submit();
        const alert = $('.alert-danger li').getText();
        expect(alert).toEqual('An email address required.');
    })
    xit('authentication - verify email address format validation', () => {
        browser.url('');
        naviSec.login();
        loginPage.username.setValue('mufasa');
        loginPage.password.setValue('');
        loginPage.submit();
        const alert = $('.alert-danger li').getText();
        expect(alert).toEqual('Invalid email address.');
    })
    xit('authentication - password is required', () => {
        browser.url('');
        naviSec.login();
        loginPage.username.setValue('adelquis.trinidad@endava.com');
        loginPage.password.setValue('');
        loginPage.submit();
        const alert = $('.alert-danger li').getText();
        expect(alert).toEqual('Password is required.');
        browser.pause(3000);
    })
})

