import naviSec from '../page-objects/nav.section.js'
import creationSec from '../page-objects/create.page.js'

describe('automation practice page access', () => {

    xit('verify access to Authentication screen', () => {
        browser.url('');
        naviSec.login();
        expect($('head > title').getTitle()).toEqual('Login - My Store');
    })

    xit('verify if create account form exists', () => {
        browser.url('');
        naviSec.login();
        browser.pause(2000);  //sin agregar la pausa isDisplayed() tiraba false en vez de true
        expect($('#create-account_form').isDisplayed()).toBe(true);
    })

    xit('verify default content of email address text box', () => {
        browser.url('');
        naviSec.login();
        expect($('#email_create').getValue()).toEqual('');
    })

    xit('verify trying to create account with existing email address', () => {
        browser.url('');
        naviSec.login();
        creationSec.createAddress.setValue('adelquis.trinidad@endava.com');
        creationSec.submitCreate();
        expect($('#create_account_error > ol > li').getText()).toEqual('An account using this email address has already been registered. Please enter a valid password or request a new one.')
    })

    xit('verify look & feel of create account section', () => {
        browser.url('');
        naviSec.login();
            expect($('#create-account_form > h3').getText()).toEqual('CREATE AN ACCOUNT');
            expect($('#create-account_form > div > p').getText()).toEqual('Please enter your email address to create an account.');
            expect($('#create-account_form > div > div.form-group > label').getText()).toEqual('Email address');
            expect($('#email_create').isEnabled()).toBe(true);
            expect($('#SubmitCreate > span').isClickable()).toBe(true);
        // #create-account_form > div > div.form-group.form-error  (red mark?) , y que más faltaría para completar un look&feel para este caso
    })

    xit('verify create account email submit with unexisting address', () => {
        browser.url('');
        naviSec.login();
        creationSec.createAddress.setValue('francasdcasd@hotmail.com');
        creationSec.submitCreate();
        browser.pause(3000);
        expect($('.std div').isDisplayed()).toBe(true);
    })

    it('verify email address format validation', () => {
        browser.url('');
        naviSec.login();
            creationSec.createAddress.setValue('OSCARDESTROYER');
            creationSec.submitCreate();
             //browser.pause(3000);
         expect($('#create_account_error > ol > li').getText()).toEqual('Invalid email address.');
    })

})

