"use strict";

var _auth = _interopRequireDefault(require("../page_objects/auth.page"));

var _create = _interopRequireDefault(require("../page_objects/create.page"));

var _createInfo = _interopRequireDefault(require("../page_objects/createInfo.page"));

var _nav = _interopRequireDefault(require("../page_objects/nav.section"));

var _common = _interopRequireDefault(require("../utilities/common.utilities"));

function _interopRequireDefault(obj) { return obj && obj.__esModule ? obj : { default: obj }; }

describe('User Story 003 - Create Account - Personal Info Area', () => {
  it('verify content of Personal Information Area', () => {
    _auth.default.open();

    _create.default.createAddress.setValue(_common.default.emailRandom());

    _create.default.submitCreate();

    browser.pause(2000); //without the pause I get some falsy instead of truthy :/                                              

    expect(_createInfo.default.createTitle.getText()).toEqual('CREATE AN ACCOUNT');
    expect(_createInfo.default.createSub1.getText()).toEqual('YOUR PERSONAL INFORMATION');
    expect(_createInfo.default.createGenEx1.isDisplayed()).toBe(true);
    expect(_createInfo.default.createGenEx2.isDisplayed()).toBe(true);
    expect(_createInfo.default.clientFName.isDisplayed()).toBe(true);
    expect(_createInfo.default.clientLName.isDisplayed()).toBe(true);
    expect(_createInfo.default.clientEmail.isDisplayed()).toBe(true);
    expect(_createInfo.default.clientPwd.isDisplayed()).toBe(true);
    expect(_createInfo.default.clientDay.isDisplayed()).toBe(true);
    expect(_createInfo.default.clientMonth.isDisplayed()).toBe(true);
    expect(_createInfo.default.clientYear.isDisplayed()).toBe(true);
    expect(_createInfo.default.clientCheckbox1.isEnabled()).toBe(true);
    expect(_createInfo.default.clientCheckbox2.isEnabled()).toBe(true);
  });
  it('verify radio buttons title', () => {
    _auth.default.open();

    _create.default.createAddress.setValue(_common.default.emailRandom());

    _create.default.submitCreate();

    browser.pause(1000);
    expect(_createInfo.default.createGenTitle1.getText()).toEqual('Mr.');
    expect(_createInfo.default.createGenTitle2.getText()).toEqual('Mrs.');
  });
  it('verify behavior of radio buttons', () => {
    _auth.default.open();

    _create.default.createAddress.setValue(_common.default.emailRandom());

    _create.default.submitCreate();

    browser.pause(1000);
    expect(_createInfo.default.createGender1.isEnabled()).toBe(true);
    expect(_createInfo.default.createGender1.isSelected()).toBe(false);

    _createInfo.default.createGender1.click(); //clicks on Mr.


    expect(_createInfo.default.createGender1.isSelected()).toBe(true); //verifies that Mr. was selected

    expect(_createInfo.default.createGender2.isEnabled()).toBe(true);
    expect(_createInfo.default.createGender2.isSelected()).toBe(false);

    _createInfo.default.createGender2.click(); //clicks on Mrs.


    expect(_createInfo.default.createGender2.isSelected()).toBe(true); //verifies that Mrs. was selected

    expect(_createInfo.default.createGender1.isSelected()).toBe(false); //verifies that Mr. was de-selected
  });
  it('verify that first name field is required', () => {
    _auth.default.open();

    _create.default.createAddress.setValue(_common.default.emailRandom());

    _create.default.submitCreate();

    _createInfo.default.completeReq(); //test case expected result describes that a red mark on wrong fields should also


    _createInfo.default.clientFName.clearValue(); //be displayed when submitting the form along with the alert error message,


    _createInfo.default.submitAccInfo(); //but they won't appear unless you interact directly by clicking the field and then outside


    expect(_createInfo.default.createError.getText()).toEqual('firstname is required.'); //which is why am only using the given alerts as 'expect', and red marks are verified on later tests
  });
  it('verify first name field max length', () => {
    _auth.default.open();

    _create.default.createAddress.setValue(_common.default.emailRandom());

    _create.default.submitCreate();

    _createInfo.default.completeReq();

    _createInfo.default.clientFName.setValue(_common.default.maxChar32());

    _createInfo.default.submitAccInfo();

    expect(_createInfo.default.createError.getText()).toEqual('firstname is too long. Maximum length: 32');
  });
  it('verify first name valid green check', () => {
    _auth.default.open();

    _create.default.createAddress.setValue(_common.default.emailRandom());

    _create.default.submitCreate();

    _createInfo.default.completeReq();

    expect(JSON.stringify(_createInfo.default.clientFName.getCSSProperty('color')).includes('#35b33f')).toBe(true); //verify if contains green check color code #35b33f
  });
  it('verify first name invalid red mark', () => {
    _auth.default.open();

    _create.default.createAddress.setValue(_common.default.emailRandom());

    _create.default.submitCreate();

    _createInfo.default.completeReq();

    _createInfo.default.clientFName.clearValue();

    browser.keys(['Tab']);
    expect(JSON.stringify(_createInfo.default.clientFName.getCSSProperty('color')).includes('#f13340')).toBe(true); //verify if contains red mark color code #f13340
  });
  it('verify that first name starting with a number is invalid - red mark', () => {
    _auth.default.open();

    _create.default.createAddress.setValue(_common.default.emailRandom());

    _create.default.submitCreate();

    _createInfo.default.completeReq();

    _createInfo.default.clientFName.setValue('8aaaaal');

    browser.keys(['Tab']);
    expect(JSON.stringify(_createInfo.default.clientFName.getCSSProperty('color')).includes('#f13340')).toBe(true);

    _createInfo.default.submitAccInfo();

    expect(_createInfo.default.createError.getText()).toEqual('firstname is invalid.');
  });
  it('verify that last name field is required', () => {
    _auth.default.open();

    _create.default.createAddress.setValue(_common.default.emailRandom());

    _create.default.submitCreate();

    _createInfo.default.completeReq();

    _createInfo.default.clientLName.clearValue();

    _createInfo.default.submitAccInfo();

    expect(_createInfo.default.createError.getText()).toEqual('lastname is required.');
  });
  it('verify last name field max length', () => {
    _auth.default.open();

    _create.default.createAddress.setValue(_common.default.emailRandom());

    _create.default.submitCreate();

    _createInfo.default.completeReq();

    _createInfo.default.clientLName.setValue(_common.default.maxChar32());

    _createInfo.default.submitAccInfo();

    expect(_createInfo.default.createError.getText()).toEqual('lastname is too long. Maximum length: 32');
  });
  it('verify last name valid green check', () => {
    _auth.default.open();

    _create.default.createAddress.setValue(_common.default.emailRandom());

    _create.default.submitCreate();

    _createInfo.default.completeReq();

    expect(JSON.stringify(_createInfo.default.clientLName.getCSSProperty('color')).includes('#35b33f')).toBe(true); //verify if contains green check color code #35b33f
  });
  it('verify last name invalid red mark', () => {
    _auth.default.open();

    _create.default.createAddress.setValue(_common.default.emailRandom());

    _create.default.submitCreate();

    _createInfo.default.completeReq();

    _createInfo.default.clientLName.clearValue();

    browser.keys(['Tab']);
    expect(JSON.stringify(_createInfo.default.clientLName.getCSSProperty('color')).includes('#f13340')).toBe(true); //verify if contains red mark color code #f13340
  });
  it('verify that first name starting with a number is invalid - red mark', () => {
    _auth.default.open();

    _create.default.createAddress.setValue(_common.default.emailRandom());

    _create.default.submitCreate();

    _createInfo.default.completeReq();

    _createInfo.default.clientLName.setValue('8oooool');

    browser.keys(['Tab']);
    expect(JSON.stringify(_createInfo.default.clientLName.getCSSProperty('color')).includes('#f13340')).toBe(true);
  });
  it('verify that email field is required', () => {
    _auth.default.open();

    _create.default.createAddress.setValue(_common.default.emailRandom());

    _create.default.submitCreate();

    _createInfo.default.completeReq();

    _createInfo.default.clientEmail.clearValue();

    _createInfo.default.submitAccInfo();

    expect(_createInfo.default.createError.getText()).toEqual('email is required.');
  });
  it('verify that email field is completed by default with input from previous screen', () => {
    _auth.default.open();

    _create.default.createAddress.setValue(_common.default.emailRandom());

    const mailcompare = _create.default.createAddress.getValue();

    _create.default.submitCreate();

    browser.pause(2000);
    expect(_createInfo.default.clientEmail.getValue()).toEqual(mailcompare);
  });
  it('verify email field validation when entering an already registered address', () => {
    _auth.default.open();

    _create.default.createAddress.setValue(_common.default.emailRandom());

    _create.default.submitCreate();

    _createInfo.default.completeReq();

    _createInfo.default.clientEmail.setValue('adelquis.trinidad@endava.com');

    _createInfo.default.submitAccInfo();

